def is_increasing(x):
  return all(x[i]<x[i+1] for i in range(len(x)-1))

def is_subsequence_of(x,y):
  ix,iy,lx,ly=0,0,len(x),len(y)
  while ix<lx and iy<ly:
    while iy<ly and y[iy]!= x[ix]:
      iy += 1
    if iy<ly:
      ix += 1
      iy += 1
  return ix==lx

def check(test_list,exercise):
  for index,(instance,lenresul) in enumerate(test_list):
    copia_instance = instance[:]
    resul = exercise(copia_instance)
    if len(resul) != lenresul or not is_increasing(resul) or not is_subsequence_of(resul,instance):
      print("Test number %d failed" % (index,))
      return False
  print("Congratulations. Your code passed the test")
  return True

if __name__ == "__main__":
  check(test_list,ejercicio4)

